webpackJsonp([0x82008a2e043c],{717:function(t,e){t.exports={data:{site:{siteMetadata:{title:"Solar Sailer",author:"Matthieu Oger"}},markdownRemark:{html:'<p><a href="http://ignorethecode.net/blog/2013/08/29/nintendo/">Great article</a> (as usual) by Lukas Mathis:</p>\n<blockquote>\n<p>But the 2DS just isn’t made for people like me. That doesn’t mean it’s going to fail. That doesn’t mean it’s a bad product. It just means it’s not for me.</p>\n<p>And this, finally, brings all of this back to the topic of design. If you want to design a successful product, don’t design a product that’s only good for people like you, because most people aren’t like you.</p>\n</blockquote>\n<p>Do not miss the footnotes either.</p>',frontmatter:{date:"2013-08-30",readableDate:"30 August 2013",title:"Nintendo 2DS",showPageTitle:null},fields:{path:"/2013/08/nintendo-2ds/"}}},pathContext:{id:"/Users/ashen/Code/solarsailer.net/content/posts/2013-08-30-nintendo-2ds.md absPath of file >>> MarkdownRemark"}}}});
